import './App.css';
import Post from './pages/Post';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
      <Routes>
          <Route path="/" element={<Main />}/>
          <Route path="/post" element={<Post />}/>
      </Routes>
  );
}

export default App;
